\nelse\n    echo \"⚠️ Crashlytics upload completed with warnings (code: $UPLOAD_RESULT)\"\nfi\n\n# Output dosyası oluştur\nmkdir -p \"${DERIVED_FILE_DIR}\"\necho \"Crashlytics upload completed at $(date) with result: $UPLOAD_RESULT\" > \"${DERIVED_FILE_DIR}/crashlytics-upload-symbols\"\n\necho \"🎉 Crashlytics script execution finished\"\n";
